import React from 'react';
import './Footer.css'; // Make sure to create this CSS file

function Footer() {
    return (
        <footer className="footer">
            <p>Coded by Nodo</p>
            <div className="social-links">
                <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer">
                    <img src={`${process.env.PUBLIC_URL}/iwy-logo.png`} alt="GitHub" />
                </a>
                <a href="https://twitter.com/yourusername" target="_blank" rel="noopener noreferrer">
                    <img src={`${process.env.PUBLIC_URL}/iwy-logo.png`} alt="Twitter" />
                </a>
                <a href="https://archiveofourown.org/users/yourusername" target="_blank" rel="noopener noreferrer">
                    <img src={`${process.env.PUBLIC_URL}/iwy-logo.png`} alt="AO3" />
                </a>
            </div>
        </footer>
    );
}

export default Footer;
